import React from 'react';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';


const Sign_img = () => {
    return (
        <>
            <div className='right-data mt-5 mb-5'>
                {/* <div className='sign_img mt-5' >
                    <img src="./sign.svg" style={{ maxWidth: 400, height: 400 }} alt="" />
                </div> */}
                <Card style={{ width: '23rem', height: '30rem' }}>
                    {/* <Card.Img variant="top" src="./user2.svg" /> */}
                    <img src="./new.avif" style={{ maxWidth: 300, height: 300, border:"rgb(20,20,20)", marginLeft:'3rem',marginTop:'1rem',marginRight:'2rem' }} alt="" />
                    <Card.Body>
                        <Card.Title>Photo Authentication</Card.Title>
                        <Card.Text>
                            Please click your photo using the below button to for Authentication purpose
                        </Card.Text>
                        <Button variant="primary" style={{background:"rgb(67,185,127)", border:"rgb(67,185,127)"}}>Go somewhere</Button>
                    </Card.Body>
                </Card>
            </div>

        </>
    )
}

export default Sign_img
